01486 bool XVARIANT::FromString(XSTRING& from, XVARIANT_TYPE from_type)
01487 {
01488   XVARIANT_TYPE _type = from_type;
01489 
01490   if(_type == XVARIANT_TYPE_UNKNOWN)
01491     {
01492       if(!from.Compare(__L("null"), true))
01493         {
01494           _type = XVARIANT_TYPE_NULL;
01495         }
01496        else
01497         {
01498           if((!from.Compare(__L("true"), true)) || (!from.Compare(__L("false"), true)) || 
01499              (!from.Compare(__L("yes"), true))  || (!from.Compare(__L("no"), true))    || 
01500              (!from.Compare(__L("si"), true)))
01501             {
01502               _type = XVARIANT_TYPE_BOOLEAN;
01503             } 
01504            else
01505             {
01506               int ndecimals = 0;
01507 
01508               if(from.IsDecimalNumber(&ndecimals))
01509                 {
01510                   if(ndecimals <= 6)
01511                     {
01512                       _type = XVARIANT_TYPE_FLOAT;
01513                     }
01514                    else
01515                     { 
01516                       _type = XVARIANT_TYPE_DOUBLE;
01517                     }
01518                 }
01519                else
01520                 { 
01521                   if(from.IsNumber())
01522                     {
01523                       _type = XVARIANT_TYPE_DOUBLEINTEGER;
01524                     }
01525                 }
01526             } 
01527         }
01528 
01529       if(_type == XVARIANT_TYPE_UNKNOWN)
01530         {
01531           _type = XVARIANT_TYPE_STRING;
01532         }
01533     }                                         
01534 
01535   if(!from.IsEmpty())
01536     {
01537       type = _type;
01538 
01539       switch(_type)
01540         {
01541           case XVARIANT_TYPE_NULL             : break;      
01542       
01543           case XVARIANT_TYPE_BOOLEAN          : (*this) = from.ConvertToBoolean();                                                                      
01544                                                 size = sizeof(bool);    
01545                                                 break;
01546       
01547           case XVARIANT_TYPE_SHORT            : (*this) = (short)from.ConvertToInt();
01548                                                 size = sizeof(short);    
01549                                                 break;
01550 
01551           case XVARIANT_TYPE_WORD             : (*this) = (XWORD)from.ConvertToInt();                   
01552                                                 size = sizeof(XWORD);    
01553                                                 break;
01554 
01555           case XVARIANT_TYPE_INTEGER          : (*this) = from.ConvertToInt();                          
01556                                                 size = sizeof(int);    
01557                                                 break;
01558                                                 
01559           case XVARIANT_TYPE_DWORD            : (*this) = from.ConvertToDWord();                        
01560                                                 size = sizeof(XDWORD);    
01561                                                 break;
01562                                                 
01563           case XVARIANT_TYPE_DOUBLEINTEGER    : (*this) = from.ConvertToLongLong();                     
01564                                                 size = sizeof(long long);    
01565                                                 break;
01566                                                 
01567           case XVARIANT_TYPE_QWORD            : (*this) = from.ConvertToQWord();                                                                        
01568                                                 size = sizeof(XQWORD);                                                    
01569                                                 break;      
01570           
01571 
01572           case XVARIANT_TYPE_FLOAT            : (*this) = from.ConvertToFloat();                                                                        
01573                                                 size = sizeof(float);                                                   
01574                                                 break;      
01575 
01576           case XVARIANT_TYPE_DOUBLE           : (*this) = from.ConvertToDouble();                       
01577                                                 type = _type;
01578                                                 size = sizeof(double);    
01579                                                 break;
01580 
01581 
01582           case XVARIANT_TYPE_CHAR             : (*this) = (char)from.Get()[0];                         
01583                                                 
01584                                                 size = sizeof(char);                                                    
01585                                                 break;
01586 
01587           case XVARIANT_TYPE_XCHAR            : (*this) = (XCHAR)from.Get()[0];                        
01588                                                 size = sizeof(XCHAR);
01589                                                 break;
01590 
01591           case XVARIANT_TYPE_STRING           : { XSTRING* string = new XSTRING();
01592                                                   if(string)
01593                                                     {    
01594                                                       string->Set(from.Get());
01595                                                       
01596                                                       if(data)
01597                                                         {
01598                                                           Destroy();
01599                                                         }    
01600 
01601                                                       size = sizeof(XSTRING);
01602                                                       data = (void*)(string);
01603                                                     }
01604                                                 }
01605                                                 break;
01606 
01607           case XVARIANT_TYPE_TIME             : { XDATETIME* datetime = GEN_XFACTORY.CreateDateTime();
01608                                                   if(datetime) 
01609                                                     {
01610                                                       datetime->GetDateTimeFromStringISO8601(from,  XDATETIME_FORMAT_ADDTIME               | 
01611                                                                                                     XDATETIME_FORMAT_TIMEWITHSECONDS       |
01612                                                                                                     XDATETIME_FORMAT_TIMEWITHMILLISECONDS  |
01613                                                                                                     XDATETIME_FORMAT_ISO8601_ADDHOUROFFSET);                                                                                             
01614                                                       if(data)
01615                                                         {
01616                                                           Destroy();
01617                                                         }    
01618 
01619                                                       size = sizeof(XDATETIME);
01620                                                       data = (void*)(datetime);       
01621                                                     }
01622                                                 }                                            
01623                                                 break;
01624 
01625           case XVARIANT_TYPE_DATE             : { XDATETIME* datetime = GEN_XFACTORY.CreateDateTime();
01626                                                   if(datetime) 
01627                                                     {
01628                                                       datetime->CopyFrom(((XDATETIME*)this->data));      
01629 
01630                                                       datetime->GetDateTimeFromStringISO8601(from, 0);  
01631 
01632                                                       if(data)
01633                                                         {
01634                                                           Destroy();
01635                                                         }    
01636 
01637                                                       size = sizeof(XDATETIME);
01638                                                       data = (void*)(datetime);       
01639                                                     }
01640                                                 }
01641                                                 break;
01642     
01643           case XVARIANT_TYPE_DATETIME         : { XDATETIME* datetime = GEN_XFACTORY.CreateDateTime();
01644                                                   if(datetime) 
01645                                                     {                                                      
01646                                                       datetime->GetDateTimeFromStringISO8601(from, XDATETIME_FORMAT_ISO8601_STANDARD      |
01647                                                                                                    XDATETIME_FORMAT_TIMEWITHSECONDS       |
01648                                                                                                    XDATETIME_FORMAT_TIMEWITHMILLISECONDS  |
01649                                                                                                    XDATETIME_FORMAT_ISO8601_ADDHOUROFFSET);                                                                                         
01650                                                       if(data)
01651                                                         {
01652                                                           Destroy();
01653                                                         }    
01654 
01655                                                       size = sizeof(XDATETIME);
01656                                                       data = (void*)(datetime);       
01657                                                     }
01658                                                 }
01659                                                 break;
01660 
01661           case XVARIANT_TYPE_BUFFER           : { XBUFFER* buffer = new XBUFFER();
01662                                                   if(buffer)
01663                                                     {                                                      
01664                                                       buffer->ConvertFromBase64(from);
01665 
01666                                                       if(data)
01667                                                         {
01668                                                           Destroy();
01669                                                         }    
01670 
01671                                                       size = sizeof(XBUFFER);
01672                                                       data = (void*)(buffer);                                                       
01673                                                     }                                                                                                                                                        
01674                                                 }                                                                                                                                                                     
01675                                                 break;
01676                                                                 
01677           case XVARIANT_TYPE_POINTER          : from.UnFormat(__L("[%08X]"), this->data);                                                                                                                    
01678                                                 size = sizeof(void*);
01679                                                 break;      
01680 
01681                             default           : return false;
01682         }
01683     }
01684 
01685   return true;
01686 }
