01703 
01713 bool XVARIANT::Destroy()
01714 {
01715   if(data)
01716     {
01717       switch(this->type)
01718         { 
01719           case XVARIANT_TYPE_NULL           : break;
01720 
01721           case XVARIANT_TYPE_BOOLEAN        : delete (bool*)data;           break;
01722 
01723           case XVARIANT_TYPE_SHORT          : delete (short*)data;          break;
01724           case XVARIANT_TYPE_WORD           : delete (XWORD*)data;          break;          
01725           case XVARIANT_TYPE_INTEGER        : delete (int*)data;            break;
01726           case XVARIANT_TYPE_DWORD          : delete (XDWORD*)data;         break;          
01727           case XVARIANT_TYPE_DOUBLEINTEGER  : delete (long long*)data;      break;
01728           case XVARIANT_TYPE_QWORD          : delete (XQWORD*)data;         break;
01729 
01730           case XVARIANT_TYPE_FLOAT          : delete (float*)(data);        break;
01731           case XVARIANT_TYPE_DOUBLE         : delete (double*)(data);       break;
01732 
01733           case XVARIANT_TYPE_CHAR           : delete (char*)(data);         break;
01734           case XVARIANT_TYPE_XCHAR          : delete (XCHAR*)(data);        break;          
01735 
01736           case XVARIANT_TYPE_STRING         : { XSTRING* string = (XSTRING*)data;
01737                                                 delete string;      
01738                                               }
01739                                               break;      
01740 
01741           case XVARIANT_TYPE_DATE           :
01742           case XVARIANT_TYPE_TIME           :
01743           case XVARIANT_TYPE_DATETIME       : { XDATETIME* datetime = (XDATETIME*)data;    
01744                                                 delete datetime;  
01745                                               }
01746                                               break;
01747 
01748           case XVARIANT_TYPE_BUFFER         : { XBUFFER* buffer = (XBUFFER*)data;
01749                                                 delete buffer;      
01750                                               }
01751                                               break;
01752 
01753           case XVARIANT_TYPE_POINTER        : delete (XBYTE*)(data);         break;           
01754 
01755                                   default   : break;
01756         }
01757     }
01758 
01759   type    = XVARIANT_TYPE_NULL;
01760   size    = 0;
01761   data    = NULL;
01762 
01763   return true;
01764 }
